/**
 * Get Gutenberg embeds from content.
 *
 * This function is responsible for getting Gutenberg embeds from content.
 * It will return an array of embeds if found, or, null if not found.
 *
 * @since ??
 *
 * @param {string} content Content to check for Gutenberg embeds.
 * @param {RegExp} embeds  Regular expression to match known Gutenberg embeds.
 *
 * @returns {RegExpMatchArray|null} Gutenberg embeds.
 *
 * @example
 * ```js
 * const content = `<!-- wp:core-embed/youtube {
 *  "url":"https://www.youtube.com/watch?v=q9XI0Lo-SWE",
 *  "type":"video",
 *  "providerNameSlug":"youtube",
 *  "responsive":true,
 *  "className":"wp-embed-aspect-16-9 wp-has-aspect-ratio""
 * } /-->`;
 * const embeds = /<!--\swp:core-embed\/(.*?)\s(.*?)\s\/-->/g;
 *
 * getGutenbergEmbeds(content, embeds);
 * // => [
 * //  '<!-- wp:core-embed/youtube {
 * //   "url":"https://www.youtube.com/watch?v=q9XI0Lo-SWE",
 * //   "type":"video",
 * //   "providerNameSlug":"youtube",
 * //   "responsive":true,
 * //   "className":"wp-embed-aspect-16-9 wp-has-aspect-ratio""
 * //  } /-->'
 * // ]
 * ```
 */
export declare const getGutenbergEmbeds: (content: string, embeds: RegExp) => RegExpMatchArray | null;
